import Personlist from './Personlist'
import Searchbox from './Searchbox'
import {people} from './People'


class App extends Component (){
    constructor(){
        super()
        this.state={
            people:people,
            searchField:''
        }
    }
    render(){
        return (
            <div className='tc'>
                <div>
                    <h1 className='georgia f2'>Passionate Moods</h1>
                </div>

                <Searchbox/>

                <Personlist people={this.people}/>
            </div>
    )
}

}



export default App;
